sap.ui.define(["sap/ui/test/opaQunit","sap/ui/demo/todo/test/integration/pages/App"],function(e){"use strict";QUnit.module("Filter");e("should show correct items when filtering for 'Active' items",function(e,t,o){e.iStartMyApp();t.onTheAppPage.iFilterForItems("active");o.onTheAppPage.iShouldSeeItemCount(1);o.iTeardownMyApp()});e("should show correct items when filtering for 'Completed' items",function(e,t,o){e.iStartMyApp();t.onTheAppPage.iFilterForItems("completed");o.onTheAppPage.iShouldSeeItemCount(1);o.iTeardownMyApp()});e("should show correct items when filtering for 'Completed' items and switch back to 'All'",function(e,t,o){e.iStartMyApp();t.onTheAppPage.iFilterForItems("completed");o.onTheAppPage.iShouldSeeItemCount(1);t.onTheAppPage.iFilterForItems("all");o.onTheAppPage.iShouldSeeItemCount(2);o.iTeardownMyApp()})});